package T0438;

import java.util.*;

/**
 * 给定一个字符串 s 和一个非空字符串 p，找到 s 中所有是 p 的字母异位词的子串，返回这些子串的起始索引。
 *
 * 字符串只包含小写英文字母，并且字符串 s 和 p 的长度都不超过 20100。
 *
 * 说明：
 *
 * 字母异位词指字母相同，但排列不同的字符串。
 * 不考虑答案输出的顺序。
 * 示例 1:
 *
 * 输入:
 * s: "cbaebabacd" p: "abc"
 *
 * 输出:
 * [0, 6]
 *
 * 解释:
 * 起始索引等于 0 的子串是 "cba", 它是 "abc" 的字母异位词。
 * 起始索引等于 6 的子串是 "bac", 它是 "abc" 的字母异位词。
 *
 * 来源：力扣（LeetCode）
 * 链接：https://leetcode-cn.com/problems/find-all-anagrams-in-a-string
 * 著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
 */
public class Solution {
    public List<Integer> findAnagrams(String s, String p) {
        HashMap<Character, Integer> cache = new HashMap<>();
        HashMap<Character, Integer> record = new HashMap<>();
        for (char c : p.toCharArray()) {
            if (cache.containsKey(c)) {
                cache.put(c, cache.get(c) + 1);
                record.put(c, record.get(c) + 1);
            } else {
                cache.put(c, 1);
                record.put(c, 1);
            }
        }

        List<Integer> result = new ArrayList<>();
        char lChar, rChar;
        int r;
        int lastR = 0;
        for (int l = 0; l <= s.length() - p.length(); l++) {
            lChar = s.charAt(l);
            if (cache.containsKey(lChar)) {
                int count = cache.get(lChar);
                cache.put(lChar, count - 1);
                r = Math.max(l, lastR);
                int len = l + p.length();
                while (++r < len) {
                    rChar = s.charAt(r);
                    if (!cache.containsKey(rChar)) {
                        l = r;
                        break;
                    } else if (cache.get(rChar) > 0) {
                        int rCount = cache.get(rChar);
                        cache.put(rChar, rCount - 1);
                    } else {
                        break;
                    }
                }

                for (char c : record.keySet()) {
                    cache.put(c, record.get(c));
                }

                if (r - l == p.length()) {
                    result.add(l);
                    lastR = r - 1;
                }
            }
        }
        return result;
    }

    public static void main(String[] args) {
        long time = System.currentTimeMillis();
        List<Integer> result = new Solution().findAnagrams("",
                "");
        System.out.println(System.currentTimeMillis() - time);

        for (int i : result) {
            System.out.println(i);
        }
    }
}
